import React from "react";
import { Link } from "react-router-dom";

const Orders = () => {
  return (
    <div className="orders">
      <table>
        <tr>
          <th></th>name
          <th></th>qty
          <th></th>price
          <th></th>mode
        </tr>
      </table>
    </div>
  );
};

export default Orders;
